  const [bodyPart, setBodyPart] = useState('all');

  console.log(bodyPart);

  return (
    <Box>
      <HeroBanner />
      <SearchExercises 
        setExercises={setExercises}
        bodyPart={bodyPart}
        setBodyPart={setBodyPart} />
      <Exercises 
        exercises={exercises}
        setExercises={setExercises}
        bodyPart={bodyPart}/>
    </Box>
  )
}

export default Home
